import React, {useState} from "react";
import "./Login.css";

const Login = () => {
    const [company_id, setCompanyid] = useState("");
    const [password, setPassword] = useState("");
    const [allEntry, setAllEntry] = useState([]);
    const submitForm = (e) => {
        e.preventDefault();
        const newEntry = {company_id:company_id, password:password}
        setAllEntry([...allEntry, newEntry]);
    }
 
return (
<>
<div classname="completebackground">
    <p id = "dfd"> hhhhhhhhhhhhhhh </p>
<form action="" onSubmit={submitForm}>
    <h1> <b> Welcome to Sign In / Sign up Page  </b> </h1>
    <div id ="ss">
    <ul> 
        <li> <h1> <strong> Login In  </strong></h1> 
            <ul>
    <li> <h1> Enter Your Credentials </h1>
    <div>
    <label> <h2> Company Id </h2> <br/>
    <input type="numbers" id="company_id" name="company_id" autoComplete="off" 
     value={company_id} onChange={(e) => setCompanyid(e.target.value)} required placeholder ="123456789" required/>
    </label> <br/>
    </div>
    <div>
    <label> <h2> Password </h2> <br/>
    <input type="password" id="password" name="password" autoComplete="off" 
    value={password} onChange={(e) => setPassword(e.target.value)} required placeholder ="*****" required /> 
    </label>
    </div>
    <br/>
    <button type = "Login"> Login </button> </li>
    </ul> </li> </ul>
    </div>
    </form>
    </div>
    </> 
    ); 
}
export default Login;
